@Paex79 @Roger1234k @WarMonitor3 If this lasts years Russia will lose.

GB, France, Germany, Spain and so on are training Ukrainian troops, with other countries helping out with trainers. An EU level training program is coming.

Add in the US and Ukraine has about 20 times the economy and industry backing them.

@Barnacules @MrsBarnacules @verified I've been following #OSINT since the invasion of #Ukraine.

But since the Musk takeover, I get a lot of these "unavailable" errors when I tap a notification on my phone.

From the notification, I can see that these were situation updates that weren't favorable to Russia.

@alykhansatchu Is itright to assume Putin and Xi are simply waiting out Biden? 
Q3 2023, the 2024 election campaigns will pick up steam and all major economies will be in free fall.
As soon the Ukraine war ends, Xi moves on Taiwan. An exhausted western populace would not support intervention.

@apmassaro3 No.
If we want there to be peace in Ukraine we don't need to ask about negotiation, we need to send forces in to hold lines and provide support.
If we come under fire, we show them what the US is about. Otherwise, actually put boots on the ground. If Iran can go there, so can we.
